import './conponent/header/header'
import './App.css';
import Header from './conponent/header/header';

function App() {
  return (
    <div className="App">
      <Header title="salut"/>
      <Header name="ziad"/>
      <Header date="10/"/>
      <Header note="salut"/>
      <Header img="salut"/>
    </div>
  );
}

export default App;
